import "./App.css";
import { Container } from "react-bootstrap";
import Footer from "./Components/Footer";
import Header from "./Components/Header";
import Home from "./screens/Home";
function App() {
  return (
    <Router>
      <Header />
      <main className="my-3">
        <Container>
          <h1>Ecommerce App</h1>

          <Route path="/" exact component={Home}>
            <Home />
          </Route>
        </Container>
      </main>
      <Footer />
    </Router>
  );
}

export default App;
